import React from 'react';
import {
  List,
  ListItem,
  ListItemText
} from '@material-ui/core';

import { alertData } from '../data';

export default function AlertDetail(){
  return(
    <List>
      {alertData.map((alert) =>
        <ListItem>
          <ListItemText primary={alert.detail} key={alert.id}/>
        </ListItem>
      )}
    </List>
  );
}
